import React from 'react';
import '../../src/Style/services.css'

const Services = ()=>{
    
    const personalLoanStyle = {
        width:"100%",
        height:"100%",
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./personal_loan.jpg')`
    };

    return(


        <div>
            <div style={personalLoanStyle} class="personal-loan">
                <h3>Personal loan</h3>
                  
            </div>
            <div class="bike-loan">
                <h3>Bike loan</h3>
                
            </div>
            <div class="car-loan">
                <h3>Car loan</h3>
                
            </div>
            <div class="home-loan">
                <h3>Home loan</h3>
                
            </div>

        </div>
        

    );

};

export default Services;
